import React from 'react';
import Card from './Card';
import { NavLink } from 'react-router-dom';
import './ctCard__Div.css';

function CtCard(props) {
  return (
    <div>
      <Card width='300px' height='500px' margin='10px 5px'>
        <div className='ct_card_div'>
          <NavLink
            exact
            activeClassName='menu_active'
            className='nav-link active'
            aria-current='page'
            to='/'
          >
            <img
              className='ct__img'
              src={props.image}
              // src={require(`../../../Assets/Images/Project Image/${props.image}`)}
              alt='avatar image'
            />

            <h1>{props.ct_title}</h1>
          </NavLink>
        </div>
      </Card>
    </div>
  );
}

export default CtCard;
